/* eslint-disable react/prop-types */
import React from 'react';
import { Descriptions } from 'antd';

// import { forDesktop } from '../../../styles/mediaBreakPoints';

// eslint-disable-next-line no-unused-vars
const OrderComponent = ({orders}) => {
  console.log(orders);
  return (
    <div style={{borderTop: '1px solid rgba(0,0,0,0.1)'}}>
      <br />
      <br />
      <Descriptions
        bordered
        title={orders.name}
        size="small"
      >
        <Descriptions.Item label="Brand">{orders.brand}</Descriptions.Item>
        <Descriptions.Item label="Categories">{orders.categories}</Descriptions.Item>
        <Descriptions.Item label="Date">{orders.date.substr(-13)}</Descriptions.Item>
        <Descriptions.Item label="Amount">$80.00</Descriptions.Item>
        <Descriptions.Item label="Discount">$20.00</Descriptions.Item>
        <Descriptions.Item label="Official">$60.00</Descriptions.Item>
        <Descriptions.Item label="Config Info">
          Data disk type: MongoDB
          <br />
          Database version: 3.4
          <br />
          Package: dds.mongo.mid
          <br />
          Storage space: 10 GB
          <br />
          Replication factor: 3
          <br />
          Region: East China 1
          <br />
        </Descriptions.Item>
      </Descriptions>
      <br />
      <br />
    </div>
  );
}

export default OrderComponent;
